function sendMousePad(shutdown = false){

    device.set_endpoint(2, 0x0002, 0xff00); // Lighting IF    

    var packet = [];
    packet[0x00] = 0x11;
    packet[0x01] = 0x07;
    packet[0x02] = 0x0b;
    packet[0x03] = 0x3E;
    packet[0x04] = 0x00;
    packet[0x05] = 0x01;



        var iX = Powerplay_Mat.positioning[0][0];
        var iY = Powerplay_Mat.positioning[0][1];
        var color;
        if(shutdown){
            color = hexToRgb(shutdownColor)
        }else if (LightingMode == "Forced") {
            color = hexToRgb(forcedColor)
        }else{
            color = device.subdeviceColor("PowerPlayMat",iX, iY);
        }
        packet[0x06] = color[0];
        packet[0x07] = color[1];
        packet[0x08] = color[2];

    device.write(packet, 20);
    device.pause(1);

}

function Apply()
{

    device.set_endpoint(2, 0x0001, 0xff00); // System IF    
    var packet = [];
    packet[0] = 0x10;
    packet[1] = WIRELESS;
    packet[2] = 0x0B;
    packet[3] = 0x2F;
    packet[4] = 0x01;
    device.write(packet, 7);
    device.read(packet, 7)
}

